import React from 'react';
import styled from 'styled-components';
import {ArrowRight,ArrowLeft} from "@mui/icons-material";

const Container = styled.div`
    margin-top: 41px;
    width:100%;
    height:100hv;
`
const Arrow = styled.div`

`


const Slider = () => {
    return (
      <Container>
          <Arrow>
              <ArrowRight/>
          </Arrow>
          <Arrow>
              <ArrowLeft/>
          </Arrow>
      </Container>
    )
}

export default Slider
